const mongoose = require("mongoose");
const { trim } = require("validator");

const userSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true,
    trim:true
  },
  email: {
    type: String,
    required: true,
    unique: true,
    trim: true,
  },
  password: {
    type: String,
    required: true,
    trim: true,
  },
  image: {
    type: String,
    default:
      "data:image/png;base64,",
      trim:true,
  },
  address: {
    type: Object,
    default:{
        line1:"",
        line2:"",
    }
  },
  gender: {
    type: String,
    default: "Not Selected",
  },
  dob: {
    type: String,
    default: "Not Selected",
  },
  phone: {
    type: String,
    default: "0000000000",
    trim:true,
  },
});

const User = mongoose.models.User || mongoose.model("User", userSchema);

module.exports = User;
